import { useState } from "react";
export const BoxCard = ({ result, children }) => {
  const [show, setShow] = useState(true);
  return (
    <>
      <div className={`box ${result}`}>{children}</div>
      <button onClick={() => setShow(!show)}>Toggle</button>
    </>
  );
};
